//loads base64 images into the img src of the elements of the page to enable caching of the images by cloudflare
// use the converter from https://www.base64-image.de/
var page_images={};
page_images['resume_word_cloud.png']="data:image/png;base64,";
page_images['particle_tracks_thumb.jpg']="data:image/jpeg;base64,";
page_images['thumb_pathways.jpg']="data:image/jpeg;base64,";
page_images['mars_thumb.jpg']="data:image/jpeg;base64,";
page_images['naval_air_station_thumb.jpg']="data:image/jpeg;base64,";

page_images['licensing_reuse_thumb.png']="data:image/png;base64,";

$(function(){
  $("#resume_word_cloud_png").attr("src",page_images['resume_word_cloud.png']);
  $("#particle_tracks_thumb_jpg").attr("src",page_images['particle_tracks_thumb.jpg']);
  $("#thumb_pathways_jpg").attr("src",page_images['thumb_pathways.jpg']);
  $("#mars_thumb_jpg").attr("src",page_images['mars_thumb.jpg']);
  $("#naval_air_station_thumb_jpg").attr("src",page_images['naval_air_station_thumb.jpg']);
  $("#licensing_reuse_thumb_png").attr("src",page_images['licensing_reuse_thumb.png']);
});
